@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type owl:Class .
atm:Account rdf:type owl:Class .
atm:Bank rdf:type owl:Class .
atm:CashCard rdf:type owl:Class .
atm:Customer rdf:type owl:Class .

atm:ownsCard rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy rdf:type owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:Transaction rdf:type owl:Class ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty atm:isSuccessful ;
                      owl:someValuesFrom [ rdf:type owl:Class ;
                                           owl:unionOf (atm:Successful atm:Unsuccessful) ] ] .

atm:Unsuccessful rdf:type owl:Class ;
    rdfs:subClassOf atm:Transaction ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty atm:displaysErrorMessage ;
                      owl:someValuesFrom atm:ErrorMessage ] ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty atm:ejectsCard ;
                      owl:someValuesFrom atm:CashCard ] .
